      out.write("        <script type=\"text/javascript\">\n");
      out.write("            function valid_credit_card(cardNumber) {\n");
      out.write("            // accept only digits, dashes or spaces\n");
      out.write("            if (/[^0-9-\\s]+/.test(cardNumber)) return false;\n");
      out.write("            // The Luhn Algorithm. It's so pretty.\n");
      out.write("            var nCheck = 0, nDigit = 0, bEven = false;\n");
      out.write("            cardNumber = cardNumber.replace(/\\D/g, \"\");\n");
      out.write("            for (var n = cardNumber.length - 1; n >= 0; n--) {\n");
      out.write("            var cDigit = cardNumber.charAt(n),\n");
      out.write("                    nDigit = parseInt(cDigit, 10);\n");
      out.write("            if (bEven) {\n");
      out.write("            if ((nDigit *= 2) > 9) nDigit -= 9;\n");
      out.write("            }\n");
      out.write("            nCheck += nDigit;\n");
      out.write("            bEven = !bEven;\n");
      out.write("            }\n");
      out.write("            // console.log('Value:' + cardNumber + ' , result=' + ((nCheck % 10) === 0));\n");
      out.write("            return (nCheck % 10) == 0;\n");
      out.write("            }\n");
      out.write("        </script>\n");
